ISLAMABAD, May 15 (APP): Chairman Senate, Muhammad Sadiq Sanjrani has felicitated HRH Sheikh Mohamed Bin Zayed Al Nahyan on being elected as the President of the United Arab Emirates (UAE).
Sadiq Sanjrani expressed hope that under his leadership the UAE would continue to prosper and play its positive role for lasting peace in the region and beyond, said a press release issued here on Sunday.
